import re
directions = ""
def countCollisions(directions: str):
    last_directions = 'p'
    count = 0
    while last_directions != directions:
        #collision_cases = ['RL', 'RS', 'SL', 'RSL']
        last_directions = directions
        directions, count_rs = re.subn('RS','SS',directions)
        directions, count_sl = re.subn('SL','SS',directions)
        directions, count_rsl = re.subn('RSL','SSS',directions)
        directions, count_rl = re.subn('RL','SS',directions)
        count = count_rs + count_sl + count_rsl + 2*count_rl + count
        print('last_dir_:',last_directions)
        print('direction:',directions)
        print('curr_____:',count)
    
    print(count, directions)
    return count
print(countCollisions(directions))